import React from "react";
import { Row, Col } from "react-bootstrap";
import products from "src/products";

function HomeScreen() {
  return (
    <div>
      <h1>Latest product</h1>
      <Row>

          {products.map(product=>
            
            
            <col  sm={12} md={6}  lg={4} xl={6}>
            
            <h3>{products.name}</h3>
            
            </col>
            
            
            )}
      </Row>
    </div>
  );
}

export default HomeScreen;
